FeedPackage.Description:
MongoDb.Asp.ConfigurationProvider to load asp5 Configuration from MongoDb.
Use the AddMongoDbConfiguration method to load configuration. for example
builder.AddMongoDbConfiguration("mongodb://localhost","ConfigDatabase","SettingsCollection","SettingType", "SettingValue");

